import logo from './logo.svg';
import './App.css';
import RegS from './components/RegS';


const rtests =[{
  val:"rest1",
  likes:2
},{
  val:"rest2"
},{
  val:"rest2"
}];


const App=()=> {
  return (
    <div className="App">
      {rtests.map((element,index)=>{
        return (
          <RegS key={index} val={element.val}/>
        );
      })}
    </div>
  );
}

export default App;
